import React, { useEffect, useState } from 'react';
import './RoomList.css';

// Helper to get JWT token from localStorage or cookie
function getToken() {
  return localStorage.getItem('token');
}

const RoomList = ({ onJoin, user }) => {
  const [rooms, setRooms] = useState([]);
  const [newRoom, setNewRoom] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Fetch room list with admin info
  useEffect(() => {
    fetch('http://localhost:8000/rooms')
      .then(res => res.json())
      .then(data => setRooms(data.rooms || []));
  }, []);

  // CREATE ROOM WITH AUTH
  const handleCreateRoom = async () => {
    if (!newRoom.trim()) return;
    setError('');
    setSuccess('');
    try {
      const token = getToken();
      const resp = await fetch('http://localhost:8000/rooms', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`,
        },
        body: JSON.stringify({ room: newRoom.trim() })
      });
      const data = await resp.json();
      if (resp.ok) {
        setRooms(r => [...r, { name: newRoom.trim(), admin_username: user.username }]);
        setSuccess('Room created. You are the admin!');
        setNewRoom('');
      } else {
        setError(data.detail || "Room creation failed. Login required?");
      }
    } catch (e) {
      setError("Network error, try again.");
    }
  };

  // DELETE ROOM (Visible only to admins)
  const handleDeleteRoom = async (room) => {
    if (!window.confirm(`Are you sure you want to delete room '${room.name}'?`)) return;
    try {
      const token = getToken();
      const resp = await fetch(`http://localhost:8000/rooms/${room.name}`, {
        method: 'DELETE',
        headers: { 'Authorization': `Bearer ${token}` }
      });
      if (resp.ok) {
        setRooms(r => r.filter(rm => rm.name !== room.name));
        setSuccess(`Room '${room.name}' deleted.`);
      } else {
        const data = await resp.json();
        setError(data.detail || "Failed to delete room.");
      }
    } catch (e) {
      setError("Network error, try again.");
    }
  };

  // JOIN ROOM
  const handleJoin = room => {
  if(onJoin) onJoin(room.name); // Pass the string, not the full object!
};


  return (
    <div className="roomlist-container">
      <h2 className="roomlist-title">Available Rooms</h2>
      <ul className="roomlist-list">
        {rooms.length === 0 && <li>No rooms yet.</li>}
        {rooms.map(room => (
          <li key={room.name} className="roomlist-item">
            <span className="roomlist-room">{room.name}</span>
            <div style={{ fontSize: 13, color: "#555", margin: "6px 0 0 0" }}>
              Admin: <b>{room.admin_username}</b>
            </div>
            <button className="roomlist-join-btn" onClick={() => handleJoin(room)}>
              Join
            </button>
            {/* Delete visible only for admin */}
            {user && room.admin_username === user.username && (
              <button
                style={{
                  marginLeft: 10,
                  background: "#e53e3e",
                  color: "#fff",
                  border: 'none',
                  borderRadius: 6,
                  padding: "6px 16px",
                  cursor: "pointer"
                }}
                onClick={() => handleDeleteRoom(room)}
              >
                Delete
              </button>
            )}
          </li>
        ))}
      </ul>
      <div className="roomlist-create">
        <input
          type="text"
          value={newRoom}
          onChange={e => setNewRoom(e.target.value)}
          placeholder="Create new room"
          className="roomlist-input"
        />
        <button
          className="roomlist-create-btn"
          onClick={handleCreateRoom}
          disabled={!newRoom.trim()}
        >
          Create
        </button>
      </div>
      {error && <div style={{ color: 'red', marginTop: 8 }}>{error}</div>}
      {success && <div style={{ color: 'green', marginTop: 8 }}>{success}</div>}
    </div>
  );
};

export default RoomList;
